import React from 'react'
import './Home.css'
import img from './minis.jpg'
import { Parallax } from 'react-scroll-parallax';
import person from ''


class Hobbies extends React.Component {
    render () {
        return (

            <body class="hobbies">
                <div class='about'>
                <Parallax
            className="custom-class"
            offsetXMax={-10}
            offsetXmin={20}
            slowerScrollRate
            tag="figure">
                    <img class="two" src={img} height="300em" alt="minis"></img>
                    </Parallax>
                    <Parallax
            className="custom-class"
            offsetYMax={20}
            offsetYMin={-20}
            offsetXMax={10}
            offsetXmin={-20}
            slowerScrollRate
            tag="figure">
                    <p>Hobbies I enjoy are board game, movies, and painting miniatures. </p>
                    </Parallax>
                </div>
            </body>

        )
    }
}export default Hobbies
